    render() {
        return (
            <div>
                <div className="categories-row">
                    <div className="col-md-12">
                        <div className="destination-slider owl-carousel ftco-animate">
                            <div className="item">
                                <div className="categories-destination">

                                    <a href="#" className="destination-img d-flex">
                                        <h2>Hello from the other side</h2>
